Amidst the chaos of it all, this was a very special moment for me! Making for one happy and relieved little fanboy 🙌🏽🔥

@fraserlack I’m sorry your time was cut short out there mate, caught in the crossfire. It was a blast to play by your side brother, keep spreading your positive vibes!

The chaos continues. 7.30pm tonight on 10 and 10play. @survivorau #survivorau

@jordie.hansen we kicked it off as soon as we stepped foot on the beach and it was an honour to play by your side mate. You brought so much energy, fun, joy and laughter to the Villains. I couldn’t have asked for a better friend out there to keep me sane and warm. We shared some pretty low lows, and some high highs and some special moments I’ll never forget (as in finding out you were having a baby boy, not grabbing the idol in my ass 😉)

Sorry it turned out the way it did for you, but what a gracious exit! 👏🏽 You’re going to be the best dad.

Only 5 Villains remain. When you’re on the bottom you can only go up… right?

7.30pm tonight on 10 and 10play. 
